webpackJsonp([0xa0a3f3734aef],{369:function(e,o){e.exports={data:{site:{siteMetadata:{author:{fullName:"Aleksander Gondek",githubProfile:"https://github.com/AleksanderGondek",linkedInProfie:"https://www.linkedin.com/in/aleksander-gondek/"},baseUrl:"https://aleksandergondek.github.io",keywords:["test"],shareLinksPrefix:{linkedin:"http://www.linkedin.com/shareArticle?mini=true&url=",reddit:"http://www.reddit.com/submit?url=",twitter:"https://twitter.com/intent/tweet?url=",ycombinator:"https://news.ycombinator.com/submitlink?u="},title:"Aleksander's Blog"}},markdownRemark:{html:'<p>I have found out that sometimes it can be quite difficult to find reasonable book dealing with programming related topic – not only the knowledge can quickly become obsolete, in my experience it has been increasingly more difficult to find publications which are more in-depth than online courses. It’s even harder to find a reliable, curated list of such textbooks.\nTherefore, below you can find a list of books I have found to be exceptionally useful / impactful, as a small aid for anyone searching for a good read.</p>\n<ul>\n<li><a href="https://www.goodreads.com/book/show/3735293-clean-code">Clean Code: A Handbook of Agile Software Craftsmanship</a></li>\n<li><a href="https://www.goodreads.com/book/show/26083308-the-devops-handbook?from_search=true">The DevOps Handbook: How to Create World-Class Agility, Reliability, and Security in Technology Organizations</a></li>\n<li><a href="https://www.goodreads.com/book/show/19288230-scrum">Scrum: The Art of Doing Twice the Work in Half the Time</a></li>\n<li><a href="https://www.goodreads.com/book/show/8214124-the-pragmatic-programmer">The Pragmatic Programmer: From Journeyman to Master</a></li>\n<li><a href="https://www.goodreads.com/book/show/22800567-fluent-python">Fluent Python: Clear, Concise, and Effective Programming</a></li>\n<li><a href="https://www.goodreads.com/book/show/34013922-kubernetes-in-action">Kubernetes in Action</a></li>\n<li><a href="https://www.goodreads.com/book/show/22512931-building-microservices">Building Microservices: Designing Fine-Grained Systems</a></li>\n<li><a href="https://www.goodreads.com/book/show/23463279-designing-data-intensive-applications">Designing Data-Intensive Applications</a></li>\n<li><a href="https://www.goodreads.com/book/show/34691716-designing-distributed-systems">Designing Distributed Systems: Patterns and Paradigms for Scalable, Reliable Services</a></li>\n<li><a href="https://www.goodreads.com/book/show/18323583-adaptive-code-via-c">Adaptive code via C#</a></li>\n<li><a href="https://www.goodreads.com/book/show/12544648-cracking-the-coding-interview?from_search=true">Cracking the Coding Interview: 150 Programming Questions and Solutions</a></li>\n<li><a href="https://www.goodreads.com/book/show/3396933-the-art-of-game-design">The Art of Game Design: A Book of Lenses</a></li>\n<li><a href="https://www.goodreads.com/book/show/2966354-game-design-workshop">Game Design Workshop: A Playcentric Approach to Creating Innovative Games</a></li>\n</ul>',excerpt:"I have found out that sometimes it can be quite difficult to find reasonable book dealing with programming related topic – not only the…",fields:{slug:"/resources/"},frontmatter:{date:"19 August 2018",title:"Resources",tags:["Resources","Books"]},timeToRead:2,stats:{words:195}}},pathContext:{slug:"/resources/"}}}});
